import { Outlet, Link } from "react-router-dom";
import Modal from "../components/Modal";
import { useState } from 'react';



export default function Root() {

    return (
      <>

          <div>
            <form id="search-form" role="search">
              <div
                className="sr-only"
                aria-live="polite"
              ></div>
            </form>
          </div>
          
        
        <div id="detail">
            <Outlet />
        </div>
      </>
    );
  }
